function compareFn(a: string, b: string) {
  if (
    alldata[a].guestRecomendation.length > alldata[b].guestRecomendation.length
  ) {
    return -1;
  }
  if (
    alldata[a].guestRecomendation.length < alldata[b].guestRecomendation.length
  ) {
    return 1;
  }
  // a must be equal to b
  return 0;
}
export const mostPopular = (length = 10) => {
  const list = Object.keys(alldata).sort(compareFn);
  const sliced = list.slice(0, length);
  return sliced.map((x) => alldata[x].id).filter((x) => x !== null) as string[];
};
export const recommendedId = (length = 10) => {
  const list = Object.keys(alldata);
  const result: string[] = [];
  let i = 0;
  while (i < length) {
    const idx = Math.floor(Math.random() * list.length - 1);
    const id = alldata[list[idx]].id;
    if (id && !result.includes(id)) {
      result.push(id);
      i++;
    }
  }
  return result;
};
